<script>
import {gsap} from "gsap";

export default {


  mounted() {
    function animateFidelisCircle() {
      const blueText = document.querySelector(".fidelis-svg-wrapper #blue__text");
      const blueIconCenter = document.querySelector(".fidelis-svg-wrapper #blueIconCenter");
      const blueSubText = document.querySelectorAll(".fidelis-svg-wrapper #text--network > *");
      const redText = document.querySelector(".fidelis-svg-wrapper #red__text");
      const redIconCenter = document.querySelector(".fidelis-svg-wrapper #redIconCenter");
      const redSubText = document.querySelectorAll(".fidelis-svg-wrapper #text--deception > *");

      const greenText = document.querySelector(".fidelis-svg-wrapper #green__text");
      const greenIconCenter = document.querySelector(".fidelis-svg-wrapper #greenIconCenter");
      const greenSubText = document.querySelectorAll(".fidelis-svg-wrapper #text--endpoint > *");

      const circleFidelist = document.querySelector(".fidelis-svg-wrapper g#circle");
      const fidelisSvg = document.querySelector(".fidelis-svg-wrapper #circle-right");
      const arc1 = document.querySelector(".fidelis-svg-wrapper #arc--01");
      const arc2 = document.querySelector(".fidelis-svg-wrapper #arc--01");
      const centerText = document.querySelector(".fidelis-svg-wrapper g#text");

      //Idle state
      fidelisSvg.addEventListener('mouseleave', function () {
        const tl = gsap.timeline();
        tl
          .to([redIconCenter, greenIconCenter, blueIconCenter], {duration: 0.5, autoAlpha: 0})
          .to(circleFidelist, {duration: 1, rotation: 0, transformOrigin: "center center"}, 0)
          .to(centerText, {duration: 1, autoAlpha: 1}, 0)

        ;
      });

      blueText.addEventListener("mouseenter", function () {
        const tl = gsap.timeline();
        tl
          .to([redIconCenter, greenIconCenter, centerText], {duration: 0.5, autoAlpha: 0})
          .to(circleFidelist, {duration: 1, rotation: 60, transformOrigin: "center center"}, 0)
          .to(blueIconCenter, {duration: 1, autoAlpha: 1}, 0)

        ;


      });
      redText.addEventListener("mouseenter", function () {


        const tl = gsap.timeline();
        tl
          .to([blueIconCenter, greenIconCenter, centerText], {duration: 0.5, autoAlpha: 0})
          .to(circleFidelist, {duration: 1, rotation: -185, transformOrigin: "center center"}, 0)
          .to(redIconCenter, {duration: 1, autoAlpha: 1}, 0)

        ;


      });
      greenText.addEventListener("mouseenter", function () {
        const tl = gsap.timeline();
        tl
          .to([blueIconCenter, redIconCenter, centerText], {duration: 0.5, autoAlpha: 0})
          .to(circleFidelist, {duration: 1, rotation: -65, transformOrigin: "center center"}, 0)
          .to(greenIconCenter, {duration: 1, autoAlpha: 1}, 0)

        ;

      });
    }

    animateFidelisCircle();
  }
}
</script>

